import React from "react";


class Nav extends React.Component {
    render() {
        return (
            <div className="welcome-nav">
                <div className="flex-container flex-container-style fixed-height">
                    <div className="flex-item"><span contenteditable=""></span><span className="counter logo"><img src={require('images/applelogo.png')} /></span></div>
                    <div className="flex-item"><span contenteditable=""></span><span className="counter">iPhone</span></div>
                    <div className="flex-item"><span contenteditable=""></span><span className="counter">MacBook Pro</span></div>
                    <div className="flex-item"><span contenteditable=""></span><span className="counter">Watch</span></div>
                    <div className="flex-item"><span contenteditable=""></span><span className="counter">Notify Me</span></div>
                </div>
            </div>
        );
    }
}

export default Nav;
